}

  MediaMetadata.fromJson(dynamic json) {
    _url = json['url'];
    _format = json['format'];
    _height = json['height'];
    _width = json['width'];
  }
  String? _url;
  String? _format;
  int? _height;
  int? _width;

  String? get url => _url;
  String? get format => _format;
  int? get height => _height;
  int? get width => _width;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['url'] = _url;
    map['format'] = _format;
    map['height'] = _height;
    map['width'] = _width;
    return map;
  }

}